syntax = "proto3";

package v1;
option go_package = "github.com/syncromatics/proto-schema-registry/internal/test/testProto/v1";

import "google/protobuf/wrappers.proto";
import "v1/testObject.proto";

message TestObject2 {
    repeated google.protobuf.StringValue strings = 1;
    map<string, TestObject> map_objects = 2;
    map<int32, string> string_maps = 3;
}
